import React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar'
import { withStyles } from '@material-ui/core/styles';
import Logo from '../../ressources/img/logo-font.png';
import Spruch from '../../ressources/img/Spruch.png';
import { Toolbar, Button, Grid } from '@material-ui/core';
import { mdiHomeOutline } from '@mdi/js';
import HomeIcon from '@material-ui/icons/Home'
import color from '@material-ui/core/colors/blue';
import { useTheme } from '@material-ui/core/styles';
import { palette } from '@material-ui/system';

const styles = theme => ({
    menuBar: {
        position: "static",
    },
    toolbar: {
        alignItems: 'flex-start',
        paddingTop: theme.spacing(2),
        paddingBottom: theme.spacing(0.5),
    },
    buttonToolbar: {
        alignItems: 'flex-start',
        paddingTop: theme.spacing(0.5),
        paddingBottom: theme.spacing(0.5),
    },
    root: {
        flexGrow: 1,
    },
    container: {
        direction: "row",
        justify: "center",
        alignItems: "center",
    },
    svg: {
        color: 'primary'
    }
});

class Menu extends React.Component {

    render() {
        const { classes } = this.props;

        return (
            <div className={classes.root}>
                <AppBar className={classes.menuBar} color={"primary"}>
                    <Toolbar className={classes.toolbar}>

                                <img
                                    src={Logo}
                                    alt="pianoservice-logo"
                                    width="500px" height="auto"
                                />

                                <img
                                    src={Spruch}
                                    alt="spruch"
                                    width="35%" height="auto"
                                />




                    </Toolbar>
                </AppBar>
                <Toolbar className={classes.buttonToolbar}>

                    <Button>
                        <svg width="24px" height="24px" viewBox="0 0 24 24">
                            <path className={classes.svg} d="M12 5.69L17 10.19V18H15V12H9V18H7V10.19L12 5.69M12 3L2 12H5V20H11V14H13V20H19V12H22L12 3Z" />
                        </svg>
                    </Button>
                    <Button color="inherit">Men√º</Button>

                </Toolbar>

            </div>
        )
    }
}

Menu.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Menu);
